import{_ as a,c as i,o as e,a4 as t}from"./chunks/framework.B2EPA2lv.js";const l="/assets/pricing.CsWD9Bl9.webp",b=JSON.parse('{"title":"发芽用户征集中","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Pricing.md","filePath":"guide/Pricing.md","lastUpdated":null}'),r={name:"guide/Pricing.md"},o=t('<h1 id="发芽用户征集中" tabindex="-1">发芽用户征集中 <a class="header-anchor" href="#发芽用户征集中" aria-label="Permalink to &quot;发芽用户征集中&quot;">​</a></h1><p><img src="'+l+'" alt=""></p><h2 id="三鲤发芽用户权益一览" tabindex="-1">三鲤发芽用户权益一览 <a class="header-anchor" href="#三鲤发芽用户权益一览" aria-label="Permalink to &quot;三鲤发芽用户权益一览&quot;">​</a></h2><blockquote><p>本文档最终解释权归三鲤网络所有</p></blockquote><h3 id="ai功能尝鲜体验" tabindex="-1">AI功能尝鲜体验 <a class="header-anchor" href="#ai功能尝鲜体验" aria-label="Permalink to &quot;AI功能尝鲜体验&quot;">​</a></h3><ol><li>AI数学公式识别：一键生成结构化公式，免去手动输入的麻烦。</li><li>AI表格、文字OCR：将图片中的数据快速转换为可编辑文本，提高工作效率。</li><li>AI翻译、润色、检查：多语言支持，让你的写作更加专业，无惧语言障碍。</li></ol><h3 id="一对一答疑服务" tabindex="-1">一对一答疑服务 <a class="header-anchor" href="#一对一答疑服务" aria-label="Permalink to &quot;一对一答疑服务&quot;">​</a></h3><ol><li>优先级高：发芽用户的答疑，将在我们的工作队列中被优先处理。</li><li>范围与渠道 <ul><li>范围：软件操作，bug汇报，需求定制等。</li><li>渠道：邮件，微信图文，可预约视频会议。非发芽用户（例如，后期的果实用户）不享有视频会议答疑通道。</li></ul></li><li>STEM万事屋：另外，我们也愿意为您的STEM文档内容提供力所能及的帮助，可提供解题思路。 <ul><li>数学：小学数学、中学数学（高考数学、中学数学竞赛）、高等数学（专升本、考研数学）。</li><li>计算机：中学、大学信息竞赛；Scheme、Python等语言学习。</li></ul></li></ol><h3 id="专属需求定制" tabindex="-1">专属需求定制 <a class="header-anchor" href="#专属需求定制" aria-label="Permalink to &quot;专属需求定制&quot;">​</a></h3><ol><li>模板定制：共享模板库，包括且不限于：个人简历（CV/Resume）、书籍、幻灯片、讲义、试卷、习题集、学术论文、法律合同、文学编程等。可提供具体的定制，例如大学生数学建模比赛论文模版。</li><li>插件定制：可根据需求集成 Tikz、Asymptote 等专业绘图工具，实现一站式理工套件。可定制专属计算功能插件，例如工程计算的复数，我们按照您的具体需求，编写代码实现。</li><li>更多定制：另外，我们也愿意为您的更多定制需求提供力所能及的帮助，例如，快捷键定制，界面定制等。</li></ol><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><h3 id="q1-texmacs、墨干、liii-stem三者的关系" tabindex="-1">Q1: TeXmacs、墨干、Liii STEM三者的关系 <a class="header-anchor" href="#q1-texmacs、墨干、liii-stem三者的关系" aria-label="Permalink to &quot;Q1: TeXmacs、墨干、Liii STEM三者的关系&quot;">​</a></h3><p>墨干v1.2.x基于GNU TeXmacs 2.1.2定制研发。Liii STEM v2025.x.y基于GNU TeXmacs 2.1.4定制研发。</p><p>墨干和GNU TeXmacs都是免费且自由的开源软件。Liii STEM是商业软件，需要付费使用，仅对付费用户开源。</p><h3 id="q2-墨干和liii-stem有什么区别" tabindex="-1">Q2: 墨干和Liii STEM有什么区别？ <a class="header-anchor" href="#q2-墨干和liii-stem有什么区别" aria-label="Permalink to &quot;Q2: 墨干和Liii STEM有什么区别？&quot;">​</a></h3><p>墨干是Liii STEM的社区版。社区版一般一个月发布一次，其中1.2.9.x中的x是质数，则是正式版，如果不是质数，则是应付费用户的工单而发布的版本。</p><h3 id="q3-liii-stem个人版和典藏版有什么区别" tabindex="-1">Q3: Liii STEM个人版和典藏版有什么区别？ <a class="header-anchor" href="#q3-liii-stem个人版和典藏版有什么区别" aria-label="Permalink to &quot;Q3: Liii STEM个人版和典藏版有什么区别？&quot;">​</a></h3><p>个人版是订阅制的，需要登录之后使用。 典藏版是买断制的，无需登录即可使用。</p><h3 id="q4-如何退款" tabindex="-1">Q4：如何退款？ <a class="header-anchor" href="#q4-如何退款" aria-label="Permalink to &quot;Q4：如何退款？&quot;">​</a></h3><p>基础服务费100元，剩下的部分按照时间折算。</p><h3 id="q5-ai大模型集成什么时候上线" tabindex="-1">Q5: AI大模型集成什么时候上线？ <a class="header-anchor" href="#q5-ai大模型集成什么时候上线" aria-label="Permalink to &quot;Q5: AI大模型集成什么时候上线？&quot;">​</a></h3><p>2025年1月发布基础的AI大模型集成，发芽用户可以在典藏版中填入相关帐号信息在Liii STEM中直接和大模型对话。</p><h3 id="q6-liii-stem个人版什么时候发布" tabindex="-1">Q6: Liii STEM个人版什么时候发布？ <a class="header-anchor" href="#q6-liii-stem个人版什么时候发布" aria-label="Permalink to &quot;Q6: Liii STEM个人版什么时候发布？&quot;">​</a></h3><p>Liii STEM个人版将于2025年3月发布，进入产品内测阶段，将会有更完善的大模型集成可以使用。</p><h3 id="q7-是否能支持tikz、asymptote等专业绘图工具" tabindex="-1">Q7：是否能支持Tikz、Asymptote等专业绘图工具？ <a class="header-anchor" href="#q7-是否能支持tikz、asymptote等专业绘图工具" aria-label="Permalink to &quot;Q7：是否能支持Tikz、Asymptote等专业绘图工具？&quot;">​</a></h3><p>3人以上成团提出同样需求，我们就把相关的绘图工具的集成加入工作队列。</p><h3 id="q8-成为发芽用户后-除了邮件、微信答疑以及一对一的视频会议-还有哪些答疑通道" tabindex="-1">Q8: 成为发芽用户后，除了邮件、微信答疑以及一对一的视频会议，还有哪些答疑通道？ <a class="header-anchor" href="#q8-成为发芽用户后-除了邮件、微信答疑以及一对一的视频会议-还有哪些答疑通道" aria-label="Permalink to &quot;Q8: 成为发芽用户后，除了邮件、微信答疑以及一对一的视频会议，还有哪些答疑通道？&quot;">​</a></h3><p>可以请求我们录制视频和撰写文档解答您的疑问，视频和文档都会公开发布，便于用户学习和分享，请注意从相关墨干文档中移除您的隐私信息。</p><h3 id="q9-一对一的视频会议如何预约" tabindex="-1">Q9: 一对一的视频会议如何预约？ <a class="header-anchor" href="#q9-一对一的视频会议如何预约" aria-label="Permalink to &quot;Q9: 一对一的视频会议如何预约？&quot;">​</a></h3><p>一对一的视频答疑会议预约时间必须是我们的工作时间，每周我们最多提供2小时的答疑会议时间。会议会录制，方便用户随时回顾，默认不公开，以保护您的个人隐私。</p><h3 id="q10-发芽用户作为早期支持者-有什么特殊待遇" tabindex="-1">Q10: 发芽用户作为早期支持者，有什么特殊待遇？ <a class="header-anchor" href="#q10-发芽用户作为早期支持者-有什么特殊待遇" aria-label="Permalink to &quot;Q10: 发芽用户作为早期支持者，有什么特殊待遇？&quot;">​</a></h3><p>在续购时，会有折扣。我们会承诺早期支持者（种子、发芽、果实用户）在未来能以更低的价格享受长期的优质服务。</p><p>另外，目前典藏版是早期支持者特供的，暂无计划售卖软件，我们只售卖软件服务（个人版和典藏版合计价值2999元）。</p><h3 id="q12-如何付费" tabindex="-1">Q12：如何付费？ <a class="header-anchor" href="#q12-如何付费" aria-label="Permalink to &quot;Q12：如何付费？&quot;">​</a></h3><p>发芽用户为540元/年。通过文末方式联系我们，我们会发公司收款码给您。</p><p>目前仅开放年费支付，付费后我们会发一封欢迎信给您，以发信日期为服务起始日期，次年同月同日为终止日期。</p><p>可提供发票和费用清单。</p><h2 id="购买或者咨询" tabindex="-1">购买或者咨询 <a class="header-anchor" href="#购买或者咨询" aria-label="Permalink to &quot;购买或者咨询&quot;">​</a></h2><p>直接<a href="./Contact.html">联系我们</a>。</p>',39),h=[o];function s(n,c,d,q,p,u){return e(),i("div",null,h)}const T=a(r,[["render",s]]);export{b as __pageData,T as default};
